export default <style>{`
	body{
		margin: 10px;
	}

	header{
		color: #ddddff;
		font-size: 12pt;
		font-weight: bold;
		letter-spacing: -8px;
		margin: -32px 5px;
		text-align: right;
	}

	footer{
		border-bottom: 1px solid #99c;
		bottom: 10px;
		color: #99c;
		font-size: 12pt;
		left: 10px;
		margin: 50px 0px 10px 0px;
		text-align: right;
		position: relative;
		right: 10px;
	}

	h1{
		color: #77a;
		font-size: 22pt;
		font-weight: bold;
		margin: -32px 0px;
		letter-spacing: 0px;
		text-align: left;
	}

	p{
		color: #666;
		font-size: 16pt;
		margin: 0px;
	}
`}</style>;
